import React from 'react';
import './App.css';
import Story from './components/Story';

function App() {
  const fetchStories = async () => {
    const list = await fetch("https://sv-reqres.now.sh/api/listings");
    const stories = await list.json();
    console.log(stories.data);
    // return stories.data;
  }

  let stories = fetchStories();



  return (
    <div className="wrapper">
      {stories.map(story => (
        <Story title={story.title} story={story.description} url={story.weburl}/>
      ))}
    </div>
  );
}

export default App;
